// src/components/Navbar.js
import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Navbar() {
  const navigate = useNavigate();
  const role = (localStorage.getItem("role") || "").toUpperCase();

  const logout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("role");
    localStorage.removeItem("userId");
    navigate("/login");
  };

  const navStyle = {
    background: "linear-gradient(90deg, #1f2937 0%, #1a1f2b 100%)",
    padding: "10px 25px",
    color: "#fff",
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    boxShadow: "0 2px 6px rgba(0,0,0,0.2)",
    borderBottom: "2px solid #111827",
  };

  const linkContainerStyle = {
    display: "flex",
    alignItems: "center",
    gap: "16px",
  };

  const linkStyle = {
    color: "#f1f5f9",
    textDecoration: "none",
    padding: "7px 14px",
    borderRadius: "6px",
    fontWeight: "500",
    transition: "all 0.25s ease",
    background: "transparent",
    cursor: "pointer",
  };

  const logoutButtonStyle = {
    background: "#ef4444",
    color: "#fff",
    border: "none",
    padding: "7px 16px",
    borderRadius: "6px",
    cursor: "pointer",
    fontWeight: "500",
    transition: "all 0.25s ease",
  };

  // Hook to store hover text
  const [hoverText, setHoverText] = useState({});

  // Helper to get display text
  const getText = (key, defaultText, hoverLabel) =>
    hoverText[key] ? hoverLabel : defaultText;

  return (
    <nav style={navStyle}>
      <div style={linkContainerStyle}>
        {role === "ADMIN" && (
          <Link
            to="/manage-users"
            style={linkStyle}
            onMouseEnter={() => setHoverText({ ...hoverText, admin: true })}
            onMouseLeave={() => setHoverText({ ...hoverText, admin: false })}
          >
            {getText("admin", "Admin Dashboard", "Manage Users")}
          </Link>
        )}

        {role === "CLIENT" && (
          <>
            <Link
              to="/dashboard"
              style={linkStyle}
              onMouseEnter={() => setHoverText({ ...hoverText, dashboard: true })}
              onMouseLeave={() => setHoverText({ ...hoverText, dashboard: false })}
            >
              {getText("dashboard", "Client Dashboard", "Go to Dashboard")}
            </Link>
            <Link
              to="/post-project"
              style={linkStyle}
              onMouseEnter={() => setHoverText({ ...hoverText, post: true })}
              onMouseLeave={() => setHoverText({ ...hoverText, post: false })}
            >
              {getText("post", "Post Project", "Add New Project")}
            </Link>
            <Link
              to="/contracts"
              style={linkStyle}
              onMouseEnter={() => setHoverText({ ...hoverText, contracts: true })}
              onMouseLeave={() => setHoverText({ ...hoverText, contracts: false })}
            >
              {getText("contracts", "Contracts", "View Contracts")}
            </Link>
          </>
        )}

        {role === "FREELANCER" && (
          <>
            <Link
              to="/freelancer-dashboard"
              style={linkStyle}
              onMouseEnter={() => setHoverText({ ...hoverText, freelancer: true })}
              onMouseLeave={() => setHoverText({ ...hoverText, freelancer: false })}
            >
              {getText("freelancer", "Freelancer Dashboard", "My Projects")}
            </Link>
            <Link
              to="/browse-projects"
              style={linkStyle}
              onMouseEnter={() => setHoverText({ ...hoverText, browse: true })}
              onMouseLeave={() => setHoverText({ ...hoverText, browse: false })}
            >
              {getText("browse", "Browse Projects", "Explore Projects")}
            </Link>
            <Link
              to="/contracts"
              style={linkStyle}
              onMouseEnter={() => setHoverText({ ...hoverText, contractsF: true })}
              onMouseLeave={() => setHoverText({ ...hoverText, contractsF: false })}
            >
              {getText("contractsF", "Contracts", "View Contracts")}
            </Link>
          </>
        )}

        <Link
          to="/profile"
          style={linkStyle}
          onMouseEnter={() => setHoverText({ ...hoverText, profile: true })}
          onMouseLeave={() => setHoverText({ ...hoverText, profile: false })}
        >
          {getText("profile", "Profile", "Your Profile")}
        </Link>
      </div>

      <button
        onClick={logout}
        style={logoutButtonStyle}
        onMouseOver={(e) => (e.currentTarget.style.background = "#dc2626")}
        onMouseOut={(e) => (e.currentTarget.style.background = "#ef4444")}
      >
        Logout
      </button>
    </nav>
  );
}
